INSERT INTO statement VALUES(2090,'A computer is an electronic device which takes information in digital form and performs a series of operations based on predetermined instructions to give some output.','NOUN:electronic ADJ:device NOUN:take VERB:information NOUN:digital ADJ:form NOUN:perform VERB:series NOUN:operation NOUN:base VERB:predetermine VERB:instruction NOUN:output','training','2024-03-27 17:19:25.365476','What is a computer?','PRON:be AUX:a DET:computer','');
INSERT INTO statement VALUES(2091,'The thing you''re using to talk to me is a computer.','NOUN:talk VERB:computer','training','2024-03-27 17:19:25.394199','A computer is an electronic device which takes information in digital form and performs a series of operations based on predetermined instructions to give some output.','NOUN:electronic ADJ:device NOUN:take VERB:information NOUN:digital ADJ:form NOUN:perform VERB:series NOUN:operation NOUN:base VERB:predetermine VERB:instruction NOUN:output','');
INSERT INTO statement VALUES(2092,'An electronic device capable of performing calculations at very high speed and with very high accuracy.','ADJ:device NOUN:capable ADJ:perform VERB:calculation NOUN:high ADJ:speed NOUN:high ADJ:accuracy','training','2024-03-27 17:19:25.435608','The thing you''re using to talk to me is a computer.','NOUN:talk VERB:computer','');
INSERT INTO statement VALUES(2093,'A device which maps one set of numbers onto another set of numbers.','NOUN:map VERB:set NOUN:number NOUN:set NOUN:number','training','2024-03-27 17:19:25.469949','An electronic device capable of performing calculations at very high speed and with very high accuracy.','ADJ:device NOUN:capable ADJ:perform VERB:calculation NOUN:high ADJ:speed NOUN:high ADJ:accuracy','');
INSERT INTO statement VALUES(2094,'What is a super computer?','ADJ:computer','training','2024-03-27 17:19:25.497696',NULL,'','');
INSERT INTO statement VALUES(2095,'Computers which can perform very large numbers of calculations at very high speed and accuracy are called super computers.','NOUN:perform VERB:large ADJ:number NOUN:calculation NOUN:high ADJ:speed NOUN:accuracy NOUN:call VERB:super ADJ:computer','training','2024-03-27 17:19:25.561808','What is a super computer?','ADJ:computer','');
INSERT INTO statement VALUES(2096,'A supercomputer is a computer which operates at several orders of magnatude greater speed and capacity than everyday general purpose computers, like the one you are talking to me on.','NOUN:computer NOUN:operate VERB:order NOUN:magnatude NOUN:great ADJ:speed NOUN:capacity NOUN:everyday ADJ:general ADJ:purpose NOUN:computer NOUN:like ADP:talk','training','2024-03-27 17:19:25.611692','Computers which can perform very large numbers of calculations at very high speed and accuracy are called super computers.','NOUN:perform VERB:large ADJ:number NOUN:calculation NOUN:high ADJ:speed NOUN:accuracy NOUN:call VERB:super ADJ:computer','');
INSERT INTO statement VALUES(2097,'You know, the big iron!','VERB:big ADJ:iron','training','2024-03-27 17:19:25.646031','A supercomputer is a computer which operates at several orders of magnatude greater speed and capacity than everyday general purpose computers, like the one you are talking to me on.','NOUN:computer NOUN:operate VERB:order NOUN:magnatude NOUN:great ADJ:speed NOUN:capacity NOUN:everyday ADJ:general ADJ:purpose NOUN:computer NOUN:like ADP:talk','');
INSERT INTO statement VALUES(2098,'Who invented computers?','VERB:computer','training','2024-03-27 17:19:25.707585',NULL,'','');
INSERT INTO statement VALUES(2099,'It''s a bit ambigous but British scientist Charles Babbage is regarded as the father of computers.','NOUN:ambigous ADJ:british ADJ:scientist NOUN:charles PROPN:babbage PROPN:regard VERB:father NOUN:computer','training','2024-03-27 17:19:25.746016','Who invented computers?','VERB:computer','');
INSERT INTO statement VALUES(2100,'One might argue that John von Neumann invented computers as we know them, because he invented the Princeton architecture, in which instructions and data share the same memory field but are differentiated by context.','VERB:john PROPN:von PROPN:neumann PROPN:invent VERB:computer NOUN:know VERB:invent VERB:princeton PROPN:architecture NOUN:instruction NOUN:datum NOUN:share VERB:memory NOUN:field NOUN:differentiate VERB:context','training','2024-03-27 17:19:25.795838','It''s a bit ambigous but British scientist Charles Babbage is regarded as the father of computers.','NOUN:ambigous ADJ:british ADJ:scientist NOUN:charles PROPN:babbage PROPN:regard VERB:father NOUN:computer','');
INSERT INTO statement VALUES(2101,'What was the first computer','PRON:be AUX:the DET:first ADJ:computer','training','2024-03-27 17:19:25.824606',NULL,'','');
INSERT INTO statement VALUES(2102,'It''s hard to say, but The ENIAC is regarded as the first ''real'' computer. It was developed at University of Pennsylvania in 1946.','ADJ:eniac PROPN:regard VERB:real ADJ:computer NOUN:develop VERB:university PROPN:pennsylvania','training','2024-03-27 17:19:25.893341','What was the first computer','PRON:be AUX:the DET:first ADJ:computer','');
INSERT INTO statement VALUES(2103,'You could say that the very first, primitive computer was the Jacquard Loom, which was a programmable loom that used punchcards to store the patterns it made. This made it a reprogrammable mechanical device.','ADJ:computer NOUN:jacquard PROPN:loom PROPN:programmable ADJ:loom NOUN:punchcard NOUN:store VERB:pattern NOUN:reprogrammable ADJ:mechanical ADJ:device','training','2024-03-27 17:19:25.946607','It''s hard to say, but The ENIAC is regarded as the first ''real'' computer. It was developed at University of Pennsylvania in 1946.','ADJ:eniac PROPN:regard VERB:real ADJ:computer NOUN:develop VERB:university PROPN:pennsylvania','');
INSERT INTO statement VALUES(2104,'What is a microprocessor?','PRON:be AUX:a DET:microprocessor','training','2024-03-27 17:19:26.024339',NULL,'','');
