INSERT INTO statement VALUES(2106,'A really small circuit which stores instructions and performs calculations for the computer.','ADJ:circuit NOUN:store NOUN:instruction NOUN:perform VERB:calculation NOUN:computer','training','2024-03-27 17:19:26.115802','An integrated circuit that implements the functions of a central processing unit of a computer.','ADJ:circuit NOUN:implement VERB:function NOUN:central ADJ:processing NOUN:unit NOUN:computer','');
INSERT INTO statement VALUES(2107,'The heart of the computer, to put it simply.','NOUN:computer NOUN:simply','training','2024-03-27 17:19:26.224422','A really small circuit which stores instructions and performs calculations for the computer.','ADJ:circuit NOUN:store NOUN:instruction NOUN:perform VERB:calculation NOUN:computer','');
INSERT INTO statement VALUES(2108,'The brain of a computer, to put it simply.','NOUN:computer NOUN:simply','training','2024-03-27 17:19:26.258562','The heart of the computer, to put it simply.','NOUN:computer NOUN:simply','');
INSERT INTO statement VALUES(2109,'An electronic component in which all of the parts are part of a contiguous silicon chip, instead of discrete components mounted on a larger circuit board.','ADJ:component NOUN:part NOUN:contiguous ADJ:silicon NOUN:chip NOUN:instead ADV:discrete ADJ:component NOUN:mount VERB:large ADJ:circuit NOUN:board','training','2024-03-27 17:19:26.307539','The brain of a computer, to put it simply.','NOUN:computer NOUN:simply','');
INSERT INTO statement VALUES(2110,'What is an operating system?','VERB:system','training','2024-03-27 17:19:26.328703',NULL,'','');
INSERT INTO statement VALUES(2111,'Software that coordinates between the hardware and other parts of the computer to run other software is called an operating system, or the OS.','NOUN:coordinate VERB:hardware NOUN:part NOUN:computer NOUN:run VERB:software NOUN:call VERB:operating NOUN:system NOUN:os','training','2024-03-27 17:19:26.511612','What is an operating system?','VERB:system','');
INSERT INTO statement VALUES(2112,'Windows, MacOS, Linux, UNIX... all of them are types of OSes.','PROPN:macos PROPN:linux PROPN:unix PROPN:type NOUN:oses','training','2024-03-27 17:19:26.783950','Software that coordinates between the hardware and other parts of the computer to run other software is called an operating system, or the OS.','NOUN:coordinate VERB:hardware NOUN:part NOUN:computer NOUN:run VERB:software NOUN:call VERB:operating NOUN:system NOUN:os','');
INSERT INTO statement VALUES(2113,'Android and iOS are operating systems for mobile devices.','PROPN:ios PRON:operate VERB:system NOUN:mobile ADJ:device','training','2024-03-27 17:19:27.031571','Windows, MacOS, Linux, UNIX... all of them are types of OSes.','PROPN:macos PROPN:linux PROPN:unix PROPN:type NOUN:oses','');
INSERT INTO statement VALUES(2114,'Software which implements the basic functions of a computer, such as memory access, processes, and peripheral access.','NOUN:implement VERB:basic ADJ:function NOUN:computer NOUN:memory NOUN:access NOUN:process NOUN:peripheral ADJ:access','training','2024-03-27 17:19:27.190315','Android and iOS are operating systems for mobile devices.','PROPN:ios PRON:operate VERB:system NOUN:mobile ADJ:device','');
