INSERT INTO statement VALUES(2120,'Name some computer company','NOUN:company','training','2024-03-27 17:19:27.427336',NULL,'','');
INSERT INTO statement VALUES(2121,'Do you mean hardware or software?','VERB:hardware NOUN:software','training','2024-03-27 17:19:27.461659','Name some computer company','NOUN:company','');
INSERT INTO statement VALUES(2122,'Apple makes hardware and software to run on it. Microsft only makes operating systems. HP makes only computers. These are just few names among several hundred others.','PROPN:make VERB:hardware NOUN:software NOUN:run VERB:microsft PROPN:make VERB:operating NOUN:system NOUN:hp PROPN:make VERB:computer NOUN:name','training','2024-03-27 17:19:27.515152','Do you mean hardware or software?','VERB:hardware NOUN:software','');
INSERT INTO statement VALUES(2123,'Who uses super computers?','VERB:super ADJ:computer','training','2024-03-27 17:19:27.547920',NULL,'','');
