INSERT INTO statement VALUES(3494,'What is a computer?','PRON:be AUX:a DET:computer','training','2024-03-27 17:21:02.967811',NULL,'','');
INSERT INTO statement VALUES(3495,'A computer is an electronic device which takes information in digital form and performs a series of operations based on predetermined instructions to give some output.','NOUN:electronic ADJ:device NOUN:take VERB:information NOUN:digital ADJ:form NOUN:perform VERB:series NOUN:operation NOUN:base VERB:predetermine VERB:instruction NOUN:output','training','2024-03-27 17:21:03.088112','What is a computer?','PRON:be AUX:a DET:computer','');
INSERT INTO statement VALUES(3496,'The thing you''re using to talk to me is a computer.','NOUN:talk VERB:computer','training','2024-03-27 17:21:03.141792','A computer is an electronic device which takes information in digital form and performs a series of operations based on predetermined instructions to give some output.','NOUN:electronic ADJ:device NOUN:take VERB:information NOUN:digital ADJ:form NOUN:perform VERB:series NOUN:operation NOUN:base VERB:predetermine VERB:instruction NOUN:output','');
INSERT INTO statement VALUES(3497,'An electronic device capable of performing calculations at very high speed and with very high accuracy.','ADJ:device NOUN:capable ADJ:perform VERB:calculation NOUN:high ADJ:speed NOUN:high ADJ:accuracy','training','2024-03-27 17:21:03.195338','The thing you''re using to talk to me is a computer.','NOUN:talk VERB:computer','');
INSERT INTO statement VALUES(3498,'A device which maps one set of numbers onto another set of numbers.','NOUN:map VERB:set NOUN:number NOUN:set NOUN:number','training','2024-03-27 17:21:03.237227','An electronic device capable of performing calculations at very high speed and with very high accuracy.','ADJ:device NOUN:capable ADJ:perform VERB:calculation NOUN:high ADJ:speed NOUN:high ADJ:accuracy','');
INSERT INTO statement VALUES(3499,'What is a super computer?','ADJ:computer','training','2024-03-27 17:21:03.276616',NULL,'','');
INSERT INTO statement VALUES(3500,'Computers which can perform very large numbers of calculations at very high speed and accuracy are called super computers.','NOUN:perform VERB:large ADJ:number NOUN:calculation NOUN:high ADJ:speed NOUN:accuracy NOUN:call VERB:super ADJ:computer','training','2024-03-27 17:21:03.337866','What is a super computer?','ADJ:computer','');
INSERT INTO statement VALUES(3501,'A supercomputer is a computer which operates at several orders of magnatude greater speed and capacity than everyday general purpose computers, like the one you are talking to me on.','NOUN:computer NOUN:operate VERB:order NOUN:magnatude NOUN:great ADJ:speed NOUN:capacity NOUN:everyday ADJ:general ADJ:purpose NOUN:computer NOUN:like ADP:talk','training','2024-03-27 17:21:03.399400','Computers which can perform very large numbers of calculations at very high speed and accuracy are called super computers.','NOUN:perform VERB:large ADJ:number NOUN:calculation NOUN:high ADJ:speed NOUN:accuracy NOUN:call VERB:super ADJ:computer','');
INSERT INTO statement VALUES(3502,'You know, the big iron!','VERB:big ADJ:iron','training','2024-03-27 17:21:03.425592','A supercomputer is a computer which operates at several orders of magnatude greater speed and capacity than everyday general purpose computers, like the one you are talking to me on.','NOUN:computer NOUN:operate VERB:order NOUN:magnatude NOUN:great ADJ:speed NOUN:capacity NOUN:everyday ADJ:general ADJ:purpose NOUN:computer NOUN:like ADP:talk','');
INSERT INTO statement VALUES(3503,'Who invented computers?','VERB:computer','training','2024-03-27 17:21:03.491251',NULL,'','');
INSERT INTO statement VALUES(3504,'It''s a bit ambigous but British scientist Charles Babbage is regarded as the father of computers.','NOUN:ambigous ADJ:british ADJ:scientist NOUN:charles PROPN:babbage PROPN:regard VERB:father NOUN:computer','training','2024-03-27 17:21:03.595924','Who invented computers?','VERB:computer','');
INSERT INTO statement VALUES(3505,'One might argue that John von Neumann invented computers as we know them, because he invented the Princeton architecture, in which instructions and data share the same memory field but are differentiated by context.','VERB:john PROPN:von PROPN:neumann PROPN:invent VERB:computer NOUN:know VERB:invent VERB:princeton PROPN:architecture NOUN:instruction NOUN:datum NOUN:share VERB:memory NOUN:field NOUN:differentiate VERB:context','training','2024-03-27 17:21:03.728282','It''s a bit ambigous but British scientist Charles Babbage is regarded as the father of computers.','NOUN:ambigous ADJ:british ADJ:scientist NOUN:charles PROPN:babbage PROPN:regard VERB:father NOUN:computer','');
INSERT INTO statement VALUES(3506,'What was the first computer','PRON:be AUX:the DET:first ADJ:computer','training','2024-03-27 17:21:03.826614',NULL,'','');
INSERT INTO statement VALUES(3507,'It''s hard to say, but The ENIAC is regarded as the first ''real'' computer. It was developed at University of Pennsylvania in 1946.','ADJ:eniac PROPN:regard VERB:real ADJ:computer NOUN:develop VERB:university PROPN:pennsylvania','training','2024-03-27 17:21:03.930231','What was the first computer','PRON:be AUX:the DET:first ADJ:computer','');
INSERT INTO statement VALUES(3508,'You could say that the very first, primitive computer was the Jacquard Loom, which was a programmable loom that used punchcards to store the patterns it made. This made it a reprogrammable mechanical device.','ADJ:computer NOUN:jacquard PROPN:loom PROPN:programmable ADJ:loom NOUN:punchcard NOUN:store VERB:pattern NOUN:reprogrammable ADJ:mechanical ADJ:device','training','2024-03-27 17:21:04.198372','It''s hard to say, but The ENIAC is regarded as the first ''real'' computer. It was developed at University of Pennsylvania in 1946.','ADJ:eniac PROPN:regard VERB:real ADJ:computer NOUN:develop VERB:university PROPN:pennsylvania','');
