INSERT INTO statement VALUES(3530,'Anyone who needs to work with very, very large sets of data in much shorter periods of time than is feasible with more common computer systems.','VERB:work VERB:large ADJ:set NOUN:datum NOUN:short ADJ:period NOUN:time NOUN:feasible ADJ:common ADJ:computer NOUN:system','training','2024-03-27 17:21:05.472136','Anybody who wants to work with large numbers quickly with high accuracy.','PRON:want VERB:work VERB:large ADJ:number NOUN:quickly ADV:high ADJ:accuracy','');
INSERT INTO statement VALUES(3531,'Supercomputers are generally used by scientists and researchers.','NOUN:generally ADV:scientist NOUN:researcher','training','2024-03-27 17:21:05.516041','Anyone who needs to work with very, very large sets of data in much shorter periods of time than is feasible with more common computer systems.','VERB:work VERB:large ADJ:set NOUN:datum NOUN:short ADJ:period NOUN:time NOUN:feasible ADJ:common ADJ:computer NOUN:system','');
INSERT INTO statement VALUES(3532,'I bet the MET department uses them.','VERB:met PROPN:department NOUN:use','training','2024-03-27 17:21:05.551886','Supercomputers are generally used by scientists and researchers.','NOUN:generally ADV:scientist NOUN:researcher','');
