INSERT INTO statement VALUES(3602,'Explicit is better than implicit.','PROPN:well ADJ:implicit','training','2024-03-27 17:21:15.623939','Beautiful is better than ugly.','PROPN:well ADJ:ugly','');
INSERT INTO statement VALUES(3603,'Simple is better than complex.','ADJ:well ADJ:complex','training','2024-03-27 17:21:15.667528','Explicit is better than implicit.','PROPN:well ADJ:implicit','');
