INSERT INTO statement VALUES(3609,'Although practicality beats purity.','NOUN:beat VERB:purity','training','2024-03-27 17:21:15.954625','Special cases aren''t special enough to break the rules.','ADJ:case NOUN:special ADJ:break VERB:rule','');
