INSERT INTO statement VALUES(3612,'In the face of ambiguity, refuse the temptation to guess.','NOUN:ambiguity NOUN:refuse VERB:temptation NOUN:guess','training','2024-03-27 17:21:16.084378','Unless explicitly silenced.','ADV:silence','');
